import React from "react";


export default function List(props){ 
   console.log(props.data);
    return(
        <div>
            {props.data.map(item => (
                <ul>
                    <h2>{item.id}</h2>
                    <p>{item.title}</p>
                </ul>
            )
            )}   
        </div>
    );
};
